MobileBanking_App.SolCtaScanDoc2 = function (params) {
    "use strict";
    var CtaDigitalForm = {};
    var numIntentos = 1;

    var isDevice = false
    if (typeof device !== "undefined")
        if (device.platform == "iOS" || device.platform == "Android")
            isDevice = true;

    if (params && params.id)
        CtaDigitalForm = JSON.parse(params.id);

    var viewModel = {
        viewShown: function () { },
        btnCamera: {
            text: "",
            disabled: true,
            visible: true,
            readonly: false,
            onClick: undefined
        },
        btnCameraBack: {
            text: "",
            disabled: false,
            visible: true,
            readonly: false,
            onClick: startScaningBack
        },
        btnContinuar: {
            text: "Siguiente",
            disabled: false,
            visible: false,
            readonly: false,
            onClick: Continuar
        }
    };

    function Continuar() {
        tmpFrontResult = undefined;
        tmpBackResult = undefined;
        var uri = MobileBanking_App.app.router.format({
            view: 'SolCtaSelfie',
            id: JSON.stringify(CtaDigitalForm)
        });
        MobileBanking_App.app.navigate(uri);
    }


    function startScaningBack() {
        if (numIntentos <= Parameters.IntentosScanDocument) {
            numIntentos++;
            if (isDevice)
                scanDocumentForBackSide(scanDocumentBackCallback)
            else {
                let dummyRespBack = '{"detectionResult":"ERROR","documentSide":"BACK","image":""}'
                operation = 'scanDocument';
                scanDocumentImageCallback(JSON.parse(dummyRespBack));
                scanDocumentBackCallback(JSON.parse(dummyRespBack));
            }
        }
        else {
            showQuestionMessage(CORE_TAG('DefaultTitle'), 'Superaste el número de intentos, ¿Deseas volver a escanear tu documento?',
                //actionYes
                function () {
                    numIntentos = 1;
                    startScaningBack();
                },
                //actionNo
                function () {
                    stopProcess();
                    MobileBanking_App.app.navigate('LandingPage', { root: true });
                }, undefined);
        }
    }


    function scanDocumentBackCallback(args) {
        CtaDigitalForm.ScanDocImg = {
            FRONT: tmpFrontResult,
            BACK: tmpBackResult,
            DATA: dataFromScan
        }

        if (tmpFrontResult.detectionResult == 'OK' && tmpBackResult.detectionResult == 'OK') {
            $('#containerCameraBtns').hide();
            $('#idFrontSideView2').attr("src", "data:image/png;base64, " + tmpFrontResult.image);
            $('.successScanDoc').show();
            $('#idBackSide').removeClass("defaultLivenessImg");
            $('#idBackSide').addClass("capuredImg");
            $('#btnCameraBack').dxButton('option', 'disabled', true);
            $('#btnContinuar').dxButton('option', 'visible', true);
        } else {
            showSimpleMessage(CORE_TAG('DefaultTitle'), 'CAPTURAR RESULT BACK NOT OK: ' + JSON.stringify(tmpBackResult), undefined);
            showSimpleMessage(CORE_TAG('DefaultTitle'), 'La validación del documento no ha sido satisfactoria, por favor repite tu imagen.', startScaningBack);
        }
        stopProcess();
    }



    return viewModel;
};